import React, { useContext } from "react";
import { Container, Navbar as NavbarComp, NavDropdown, Nav } from "react-bootstrap";
import { Link } from "react-router-dom";
import { userContext } from "../../context/userContext";
import booksLogo from "../../assets/books-logo.png"

function NavbarAdmin(props) {

  return (
    <NavbarComp expand="lg">
      <Container>
        <NavbarComp.Brand as={Link} to="/complain-admin">
          <img
            src={booksLogo}
            className="img-fluid rounded rounded-5"
            style={{ width: "60px", height: "60px" }}
            alt="brand"
          />
        </NavbarComp.Brand>

        <NavbarComp.Toggle aria-controls="basic-navbar-nav" />
       <NavbarComp.Toggle aria-controls="basic-navbar-nav" />
        <NavbarComp.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">

            <NavDropdown>
              <Nav.Link
                as={Link}
                to="/book-list"
                className={
                  props?.title === "Book-List"
                    ? `text-navbar-active`
                    : `text-navbar`
                }
              >
                Add Book
              </Nav.Link>
              <Nav.Link
                as={Link}
                to="/complain"
                className={
                  props?.title === "Complain"
                    ? `text-navbar-active`
                    : `text-navbar`
                }
              >
                Complain
              </Nav.Link>
              <Nav.Link onClick="" className="text-navbar">
                Logout
              </Nav.Link>
            </NavDropdown>
          </Nav>
        </NavbarComp.Collapse>
      </Container>
    </NavbarComp>
  );
}

export default NavbarAdmin;
